### Ethereum Blockchain Messenger Smart Contract

Below is a Solidity smart contract that meets the requirements:

```solidity
pragma solidity ^0.8.0;

contract BlockchainMessenger {
    // Mapping of message IDs to message data
    mapping (uint256 => Message) public messages;

    // Mapping of message IDs to update counts
    mapping (uint256 => uint256) public updateCounts;

    // Mapping of message IDs to sender addresses
    mapping (uint256 => address) public senders;

    // Counter for message IDs
    uint256 public messageIdCounter;

    // Struct to represent a message
    struct Message {
        string content;
        bool isPublic;
    }

    // Event emitted when a message is updated
    event MessageUpdated(uint256 messageId);

    // Event emitted when a new message is created
    event NewMessage(uint256 messageId, address sender);

    // Function to create a new message
    function createMessage(string memory _content, bool _isPublic) public {
        // Increment the message ID counter
        messageIdCounter++;

        // Store the message data
        messages[messageIdCounter] = Message(_content, _isPublic);

        // Store the sender address
        senders[messageIdCounter] = msg.sender;

        // Emit the NewMessage event
        emit NewMessage(messageIdCounter, msg.sender);
    }

    // Function to update a message
    function updateMessage(uint256 _messageId, string memory _newContent) public {
        // Check if the message exists
        require(messages[_messageId].content != "", "Message does not exist");

        // Check if the sender is the owner of the message
        require(msg.sender == senders[_messageId], "Only the owner can update the message");

        // Update the message content
        messages[_messageId].content = _newContent;

        // Increment the update count
        updateCounts[_messageId]++;

        // Emit the MessageUpdated event
        emit MessageUpdated(_messageId);
    }

    // Function to get a message
    function getMessage(uint256 _messageId) public view returns (string memory, bool) {
        // Check if the message exists
        require(messages[_messageId].content != "", "Message does not exist");

        // Return the message content and public status
        return (messages[_messageId].content, messages[_messageId].isPublic);
    }
}
```

### Explanation

This contract uses three mappings to store message data, update counts, and sender addresses. The `createMessage` function allows anyone to create a new message, which is stored in the `messages` mapping. The `updateMessage` function allows the owner of a message to update its content, incrementing the update count in the `updateCounts` mapping. The `getMessage` function allows anyone to retrieve a message's content and public status.

### Considerations

*   The `createMessage` function increments the `messageIdCounter` variable to ensure unique message IDs.
*   The `updateMessage` function checks if the message exists and if the sender is the owner before updating the message.
*   The `getMessage` function checks if the message exists before returning its content and public status.
*   The contract uses events to notify external contracts or off-chain applications about message updates and creations.

